let time = new Date().toLocaleString();
let date = new Date().getDay();
let year = new Date().getFullYear();

const Clock = () => {
    return (
        <p className="App-clock">
            The time is {time}.
            The date is {date}.
            The year is {year}.
            {console.log(new Date())}
        </p>
    );
}

export default Clock;
